import string
import asyncio

async def makeShortest(mystring):
 lengths = []
 for remove in string.ascii_lowercase:
     size =  (len( await outerProcessString(mystring.replace(remove, '').replace(remove.upper(), ''))))
     lengths.append(size)
     #print(remove + " : " + str(size))
 print("smallest : " + str(min(lengths)))

async def outerProcessString(current):
    string_as_list = list(current)
    last_size = len(current)
    while(True):
        processList(string_as_list)
        #print(''.join(string_as_list))

        if (last_size == len(string_as_list)):
            return ''.join(string_as_list)
        last_size = len(string_as_list)

def processList(input):
    #print("Processing " + ''.join(input))
    removeIndices = []
    i = 0
    while i < len(input)-1:
        if (reacts(input[i], input[i+1])):
            removeIndices.append(i)
            removeIndices.append(i+1)
            i = i + 1
        i = i + 1
    for index in sorted(list(set(removeIndices)), reverse=True):
        del input[index]
    return input

def reacts(z,y):
    return (((z.isupper() and y.islower()) or
            (z.islower() and y.isupper())) and
            z.upper() == y.upper())

print(asyncio.run(outerProcessString('dabAcCaCBAcCcaDA')))
asyncio.run(makeShortest('dabAcCaCBAcCcaDA'))

input = ''

print(len(asyncio.run(outerProcessString(input))))
asyncio.run(makeShortest(input))
